import React from "react";
import "../Css/Pesticides.css";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

function Pesticides() {
  const pesticides = [
    {
      id: 1,
      name: "Organic Pesticide",
      price: 320,
      img: "https://images.unsplash.com/photo-1524593166156-312f362cada2?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 2,
      name: "Fast Action Spray",
      price: 450,
      img: "https://images.unsplash.com/photo-1561454922-0e26c84a1590?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 3,
      name: "Insect Killer",
      price: 380,
      img: "https://images.unsplash.com/photo-1524593166156-312f362cada2?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 4,
      name: "Fungal Control",
      price: 290,
      img: "https://images.unsplash.com/photo-1598062548096-9f3612c3424f?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 5,
      name: "Herbal Garden Spray",
      price: 310,
      img: "https://images.unsplash.com/photo-1590502593747-42a996133562?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 6,
      name: "Neem Oil Shield",
      price: 360,
      img: "https://images.unsplash.com/photo-1590502593747-42a996133562?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 7,
      name: "Crop Protector Plus",
      price: 420,
      img: "https://images.unsplash.com/photo-1515468381878-2a0f4e24eaa4?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 8,
      name: "Eco Insect Spray",
      price: 275,
      img: "https://images.unsplash.com/photo-1517260739337-6799d3b5c5f9?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 9,
      name: "Soil Pest Control",
      price: 340,
      img: "https://images.unsplash.com/photo-1517263904808-5dc91e3e7044?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 10,
      name: "Leaf Miner Killer",
      price: 390,
      img: "https://images.unsplash.com/photo-1590502593932-3546a9a57f81?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 11,
      name: "Vegetable Guard",
      price: 330,
      img: "https://images.unsplash.com/photo-1618384887929-16ec33fab9ef?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 12,
      name: "Flower Saver Spray",
      price: 295,
      img: "https://images.unsplash.com/photo-1465406325902-7c46273c7d0e?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 13,
      name: "Termite Blocker",
      price: 520,
      img: "https://images.unsplash.com/photo-1517260739337-6799d3b5c5f9?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 14,
      name: "Ant & Roach Killer",
      price: 410,
      img: "https://images.unsplash.com/photo-1515468381878-2a0f4e24eaa4?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 15,
      name: "Fruit Fly Trap",
      price: 260,
      img: "https://images.unsplash.com/photo-1618384887929-16ec33fab9ef?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 16,
      name: "Garden Mite Control",
      price: 370,
      img: "https://images.unsplash.com/photo-1590502593747-42a996133562?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 17,
      name: "Organic Crop Shield",
      price: 450,
      img: "https://images.unsplash.com/photo-1515468381878-2a0f4e24eaa4?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 18,
      name: "Fungus Stop Spray",
      price: 310,
      img: "https://images.unsplash.com/photo-1598062548096-9f3612c3424f?auto=format&fit=crop&w=600&q=80"
    },
    {
      id: 19,
      name: "Multi-Insect Repellent",
      price: 390,
      img: "https://images.unsplash.com/photo-1517263904808-5dc91e3e7044?auto=format&fit=crop&w=600&q=80"
    }
  ];

  return (
    <>
      {/* ⭐ NAVBAR */}
      <Navbar />

      <div className="pesticide-container" style={{ marginTop: "80px" }}>
        <h2 className="pesticide-title">
          <i className="fa fa-vial"></i> Pesticides Store
        </h2>

        <div className="pesticide-grid">
          {pesticides.map((item) => (
            <div className="pesticide-card" key={item.id}>
              <img src={item.img} alt={item.name} className="pesticide-img" />

              <h3 className="pesticide-name">{item.name}</h3>

              <p className="pesticide-price">
                <i className="fa fa-rupee-sign"></i> {item.price}
              </p>

              <button className="pesticide-btn">
                <i className="fa fa-shopping-cart"></i> Buy Pesticide
              </button>
            </div>
          ))}
        </div>
      </div>

      {/* ⭐ FOOTER */}
      <Footer />
    </>
  );
}

export default Pesticides;
